pragma solidity ^0.4.4;

contract Parent {
  uint contractType = 0;

  function foo() returns(uint) {
    return contractType;
  }

  function bar() returns(uint) {
    return contractType;
  }

  function baz() returns(uint) {
    return contractType;
  }
}

contract Kid1 is Parent {
  uint contractType = 1;

  function bar() returns(uint) {
    return contractType;
  }

  function baz() returns(uint) {
    return contractType;
  }
}

contract Kid2 is Parent {
  uint contractType = 2;
  function bar() returns(uint) {
    return super.bar();
  }
  function baz() returns(uint) {
    return contractType;
  }
}

contract MyContract is Kid1, Kid2 {
  function callFoo() constant returns(uint) {
    return foo();
  }

  function callBar() constant returns(uint) {
    return bar();
  }

  function callBaz() constant returns(uint) {
    return baz();
  }
}
